Cast :Alexya Flores, Diana Dean, Evita De Luna, Laia Prats, Minerva Pons, Sara Rey, Silvia Diamond, Bryan Da Ferro, Conrad Son, Leo Galvez, Rob Diesel

Project Sneak is a brand new serial concept from Private. Sara is a film student and her college project is to film a documentary about a rock band, but this is no ordinary rock band, its Conrad Son and the Porno Band. Sara soon discovers that she is really filming a sex documentary! There is live sex on stage, live sex backstage, three super horny groupies who are desperate to fuck the band and throughout the documentary Conrad is always trying to fuck Sara! Shot at a real rock concert in front of a live audience in Barcelona, will innocent, young Sara end up being conquered by Conrad?
